    let update (xRaw : array<double>) : array<double> = 
        // printfn "update::Starting..."
        let x = xRaw |> Array.map (fun e -> max e 0.0)
        let xSum = (x |> Array.sum) - (x.[1] + x.[2] + x.[0])


        let xSumN = 
            [|
                1.0 * x.[3] // A
                1.0 * x.[4] // B
                1.0 * x.[5] // C
                1.0 * x.[6] // D
                1.0 * x.[7] // E
                1.0 * x.[8] // a
                1.0 * x.[9] // b
                1.0 * x.[10] // c
                1.0 * x.[11] // d
                1.0 * x.[12] // e
